/* eslint-disable jsx-a11y/alt-text */
import React, { Component } from 'react';
import './index.scss';

class SideBar extends Component {
	render() {
		console.log(this.props.sideBarStatus);
		return (
			<nav className={this.props.sideBarStatus ? 'side-bar-container' : 'side-bar-container sideBarHidden'}>
				<img
					src={
						this.props.sideBarStatus
							? 'https://i1.wp.com/thehackerstreet.com/wp-content/uploads/2019/09/logo.png?fit=672%2C151&ssl=1'
							: ''
					}
					className={this.props.sideBarStatus ? 'hs-label-with-img' : ''}
				/>
			</nav>
		);
	}
}

export default SideBar;
